import axios from 'axios';
import React from 'react';

const Get = ()=> {
    // const api_get = (URL: string):any => {
    axios.get("htt@://localhost:8000/produc").then((results) => {
        console.log(results.data);
        const data :string = results.data;
        return data;
    });
};
// }
export default Get;
